actionConfiguration.body:
()=>{
		let is_trip_based = PayoutCampaignForm.formData.campaigns.trip_based_incentive.active;
		let not_elig_driver_data = appsmith.store.not_elig_driver_data;
		let duplicates = appsmith.store.duplicate_elements;
		if( is_trip_based &&(typeof(not_elig_driver_data) == "undefined" || not_elig_driver_data.length !=0 || duplicates.length !=0) )
			 return true;
		else{
			  return false;
		}
	}

